import React from 'react';
import Tooltip from './Tooltip';

const MainComponent = () => {
  return (
    <div>
      <h1>Main Component</h1>
      <Tooltip
        render={({ isVisible, position, content }) => (
          <div style={{ display: isVisible ? 'block' : 'none', position, border: '1px solid black' }}>
            {content}
          </div>
        )}
        position="top"
        content="This is a tooltip"
        styles={{ marginTop: '20px' }}
      />
      {/* Другие компоненты */}
    </div>
  );
};

export default MainComponent;
